contract TestFuturePunks is ERC721Enumerable, Ownable {
    using Strings for uint256;

    uint256 public constant MAX_NFT_SUPPLY = 7777;

    uint256 public maxPurchase = 20;

    uint256 public constant reserveTokens = 50;

    uint256 public tokenPrice = 30000000000000000; // 0.03 ETH

    // SHA256 of concatenated hash string containing all the hashes of all tokens
    string public FinalProofHash;

    // IPFS hash of a json containing the metadata of all the tokens, will be uploaded when all are sold
    string public METADATA_IPFS_HASH;

    // ensures that we do not change the metadata multiple times
    bool public metadataRevealed = false;

    // expresses whether users can buy
    bool public saleIsActive = false;

    // list of addresses eligible for the first pre-sale
    address[] public _firstPresaleList;

    // list of addresses eligible for the second pre-sale
    address[] public _secondPresaleList;

    // booleans to identify the current salephase
    bool public _presaleOneEnabled = false;
    bool public _presaleTwoEnabled = false;
    bool public _publicSaleEnabled = false;

    // mapping to keep count of how many tokens an address has bought during each phase
    mapping(address => uint256) public _firstPresaleCounter;
    mapping(address => uint256) public _secondPresaleCounter;

    // number of tokens an address can buy during each presale phase
    uint256 public firstPresaleLimit = 3;
    uint256 public secondPresaleLimit = 1;

    // counter for the current token id
    uint256 public _currentTokenId = 0;

    // whether the tokenURI link needs ".json" after the tokenId
    bool internal tokenURIDotJson = false;

    constructor() ERC721("TestFuturePunks", "TFP") {}

    function buyTokens(uint256 numberOfTokens) public payable {
        require(saleIsActive, "Sale must be active to mint");
        require(_presaleOneEnabled || _presaleTwoEnabled || _publicSaleEnabled, "no phase is active");
        require(numberOfTokens > 0 && numberOfTokens <= maxPurchase, "Not within the range of maxPurchase");
        require((totalSupply() + numberOfTokens) <= MAX_NFT_SUPPLY, "Purchase would exceed max supply of FuturePunks");
        require(msg.value >= tokenPrice * numberOfTokens, "Ether value sent is not correct");

        // if (msg.sender != owner()) {
        //     if(_presaleOneEnabled == true) {
        //         require(isInFirstPresale(msg.sender), "user is not whitelisted");
        //         uint256 ownerMintedCount = _firstPresaleCounter[msg.sender];
        //         require(ownerMintedCount + numberOfTokens <= firstPresaleLimit, "max NFT per address exceeded");
        //         for (uint256 i = 0; i < numberOfTokens; i++) {
        //             uint256 id = _currentTokenId;
        //             _firstPresaleCounter[msg.sender]++;
        //             if (totalSupply() < MAX_NFT_SUPPLY) {
        //                 _safeMint(msg.sender, id);
        //             }
        //         }
        //     } else if (_presaleTwoEnabled == true) {
        //         require(isInSecondPresale(msg.sender), "user is not whitelisted");
        //         uint256 ownerMintedCount = _secondPresaleCounter[msg.sender];
        //         require(ownerMintedCount + numberOfTokens <= secondPresaleLimit, "max NFT per address exceeded");
        //         for (uint256 i = 0; i < numberOfTokens; i++) {
        //             uint256 id = _currentTokenId;
        //             _secondPresaleCounter[msg.sender]++;
        //             if (totalSupply() < MAX_NFT_SUPPLY) {
        //                 _safeMint(msg.sender, id);
        //             }
        //         }
        //     } else if (_publicSaleEnabled == true) {
        //         for (uint256 i = 0; i < numberOfTokens; i++) {
        //             uint256 id = _currentTokenId;
        //             _secondPresaleCounter[msg.sender]++;
        //             if (totalSupply() < MAX_NFT_SUPPLY) {
        //                 _safeMint(msg.sender, id);
        //             }
        //         }
        //     }
        // }

        if(_presaleOneEnabled == true) {
            require(isInFirstPresale(msg.sender), "user is not whitelisted");
            uint256 ownerMintedCount = _firstPresaleCounter[msg.sender];
            require(ownerMintedCount + numberOfTokens <= firstPresaleLimit, "max NFT per address exceeded");
            for (uint256 i = 0; i < numberOfTokens; i++) {
                uint256 id = _currentTokenId;
                _firstPresaleCounter[msg.sender]++;
                if (totalSupply() < MAX_NFT_SUPPLY) {
                    _safeMint(msg.sender, id);
                }
            }
        } else if (_presaleTwoEnabled == true) {
            require(isInSecondPresale(msg.sender), "user is not whitelisted");
            uint256 ownerMintedCount = _secondPresaleCounter[msg.sender];
            require(ownerMintedCount + numberOfTokens <= secondPresaleLimit, "max NFT per address exceeded");
            for (uint256 i = 0; i < numberOfTokens; i++) {
                uint256 id = _currentTokenId;
                _secondPresaleCounter[msg.sender]++;
                if (totalSupply() < MAX_NFT_SUPPLY) {
                    _safeMint(msg.sender, id);
                }
            }
        } else if (_publicSaleEnabled == true) {
            for (uint256 i = 0; i < numberOfTokens; i++) {
                uint256 id = _currentTokenId;
                _secondPresaleCounter[msg.sender]++;
                if (totalSupply() < MAX_NFT_SUPPLY) {
                    _safeMint(msg.sender, id);
                }
            }
        }
    }

    function metadataURI() public view returns (string memory) {
        return string(abi.encodePacked("ipfs://", METADATA_IPFS_HASH));
    }

    function tokensOfOwner(address _owner) external view returns (uint256[] memory ) {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 index;
            for (index = 0; index < tokenCount; index++) {
                result[index] = tokenOfOwnerByIndex(_owner, index);
            }
            return result;
        }
    }

    // checks whether the address is on the whitelist for 2nd presale
    function isInFirstPresale(address user) public view returns (bool answer) {
        for (uint i = 0; i < _firstPresaleList.length; i++) {
            if (_firstPresaleList[i] == user) {
                return true;
            }
        }
        return false;
    }

    // checks whether the address is on the whitelist for 2nd presale
    function isInSecondPresale(address user) public view returns (bool answer) {
        for (uint i = 0; i < _firstPresaleList.length; i++) {
            if (_secondPresaleList[i] == user) {
                return true;
            }
        }
        return false;
    }

    function tokenURI(uint256 _tokenId) public view virtual override returns (string memory) {
        if (tokenURIDotJson == true) {
            return string(abi.encodePacked(baseURI(), _tokenId.toString(), ".json"));
        } else {
            return string(abi.encodePacked(baseURI(), _tokenId.toString()));
        }
    }

    // OWNER ONLY FUNCTIONS

    // add a whole array of addresses to the list of whitelisted addresses for the first presale
    function setFirstPresaleList(address[] memory addresses) public onlyOwner {
        _firstPresaleList = addresses;
    }

    // add a whole array of addresses to the list of whitelisted addresses for the second presale
    function setSecondPresaleList(address[] memory addresses) public onlyOwner {
        _secondPresaleList = addresses;
    }

    // change token price
    function changeTokenPrice(uint256 newPrice) public onlyOwner {
        tokenPrice = newPrice;
    }

    // start the 1st round of pre-sale
    function startFirstPresale() public onlyOwner {
        _presaleOneEnabled = true;
    }

    // start the 2nd round of pre-sale
    function startSecondPresale() public onlyOwner {
        _presaleOneEnabled = false;
        _presaleTwoEnabled = true;
    }

    // change the amount of tokens you can mint during the first presale
    function changeFirstPresaleLimit(uint256 amount) public onlyOwner {
        firstPresaleLimit = amount;
    }

    // change the amount of tokens you can mint during the second presale
    function changeSecondPresaleLimit(uint256 amount) public onlyOwner {
        secondPresaleLimit = amount;
    }

    // start the public sale
    function startPublicSale() public onlyOwner {
        _presaleTwoEnabled = false;
        _publicSaleEnabled = true;
    }

    // reveals the metadata and prohibits further changes
    function revealMetadata(string memory finalHash, string memory metadataHash) public onlyOwner {
        require(metadataRevealed != true, "FuturePunks: You've already revealed the metadata!");

        FinalProofHash = finalHash;
        METADATA_IPFS_HASH = metadataHash;
        metadataRevealed = true;
    }

    // change the amount of tokens users can buy at once
    function changeMaxPurchase(uint256 amount) public onlyOwner {
        maxPurchase = amount;
    }

    // withdraw all the Ether from the contract to the owner
    function withdrawAll() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(msg.sender).transfer(balance);
    }

    // set baseURI
    function setBaseURI(string memory baseURI) public onlyOwner {
        _setBaseURI(baseURI);
    }

    // switches between using and not using the ".json" extension
    function switchDotJson() public onlyOwner {
        if (tokenURIDotJson == true) {
            tokenURIDotJson = false;
        } else {
            tokenURIDotJson = true;
        }
    }

    // allows minting
    function flipSaleIsActive() public onlyOwner {
        saleIsActive = true;
    }

    /* receive 50 tokens for the team and marketing purposes, then start the sale
    this function will be called 2 times due to the gas limit (25 in each transaction) */
    function getReserves() public onlyOwner {
        require(saleIsActive == false, "FuturePunks: Reserves taken and sale started already!");

        for (uint256 i = 0; i < 25; i++) {
            uint256 id = _currentTokenId;
            if (totalSupply() < MAX_NFT_SUPPLY) {
                _safeMint(msg.sender, id);
            }
        }
    }
}

